import React, { Component } from 'react';
import Link from '../utils/ActiveLink';

class NavbarTwo extends Component {
    // Navbar 
    _isMounted = false;
    state = {
        display: false,
        collapsed: true
    };
    toggleNavbar = () => {
        this.setState({
            collapsed: !this.state.collapsed,
        });
    }
    componentDidMount() {
        let elementId = document.getElementById('navbar');
        document.addEventListener('scroll', () => {
            if (window.scrollY > 170) {
                elementId.classList.add('is-sticky');
            } else {
                elementId.classList.remove('is-sticky');
            }
        });
        window.scrollTo(0, 0);
    }
    componentWillUnmount() {
        this._isMounted = false;
    }

    render() {

        const { collapsed } = this.state;
        const classOne = collapsed ? 'collapse navbar-collapse' : 'collapse navbar-collapse show';
        const classTwo = collapsed ? 'navbar-toggler navbar-toggler-right collapsed' : 'navbar-toggler navbar-toggler-right';

        return (
            <React.Fragment>
                <div id='navbar' className='navbar-area navbar-style-2'>
                    <nav className='navbar navbar-expand-md navbar-light'>
                        <div className='container-fluid'>
                            <Link href='/'>
                                <a className='navbar-brand'>
                                    <img src={require('../images/logo-black-transparent.png')} className='black-logo' alt='logo' style={{ maxWidth: '150px' }} />
                                    <img src={require('../images/logo-white-transparent.png')} className='white-logo' alt='logo' style={{ maxWidth: '150px' }}  />
                                </a>
                            </Link>

                            {/* Toggle navigation */}
                            <button 
                                onClick={this.toggleNavbar} 
                                className={classTwo}
                                type='button' 
                                data-toggle='collapse' 
                                data-target='#navbarSupportedContent' aria-controls='navbarSupportedContent' 
                                aria-expanded='false' 
                                aria-label='Toggle navigation'
                            >
                                <span className='icon-bar top-bar'></span>
                                <span className='icon-bar middle-bar'></span>
                                <span className='icon-bar bottom-bar'></span>
                            </button>

                            <div className={classOne} id='navbarSupportedContent'>
                                <ul className='navbar-nav'>
                                    <li className='nav-item'>
                                        <Link href='/' activeClassName='active'>
                                            <a className='nav-link'>Home</a>
                                        </Link>
                                    </li>
                                    <li className='nav-item'>
                                        <Link href='/services' activeClassName='active'>
                                            <a className='nav-link'>What We Offer</a>
                                        </Link>
                                    </li>
                                    <li className='nav-item'>
                                        <Link href='/blog' activeClassName='active'>
                                            <a className='nav-link'>Blog</a>
                                        </Link>
                                    </li>






                                    <li className='nav-item'>
                                        <Link href='/'>
                                            <a className='nav-link'>
                                                Blog <i className='icofont-thin-down'></i>
                                            </a>
                                        </Link>

                                        <ul className='dropdown-menu'>
                                            <li className='nav-item'>
                                                <Link href='/blog' activeClassName='active'>
                                                    <a className='nav-link'>Blog Grid</a>
                                                </Link>
                                            </li>

                                            <li className='nav-item'>
                                                <Link href='/blog2' activeClassName='active'>
                                                    <a className='nav-link'>Blog Right Sidebar</a>
                                                </Link>
                                            </li>

                                            <li className='nav-item'>
                                                <Link href='/blog3' activeClassName='active'>
                                                    <a className='nav-link'>Blog Left Sidebar</a>
                                                </Link>
                                            </li>

                                            <li className='nav-item'>
                                                <Link href='/blog-details' activeClassName='active'>
                                                    <a className='nav-link'>Blog Details</a>
                                                </Link>
                                            </li>
                                        </ul>
                                    </li>

                                    <li className='nav-item'>
                                        <Link href='/contact' activeClassName='active'>
                                            <a className='nav-link'>Contact Us</a>
                                        </Link>
                                    </li>
                                </ul>

                                <div className='others-options'>
                                    <Link href='/pricing'>
                                        <a className='btn btn-primary'>
                                            Let's Begin
                                        </a>
                                    </Link>
                                </div>
                            </div>
                        </div>
                    </nav>
                </div>
            </React.Fragment>
        );
    }
}

export default NavbarTwo;
